from PyQt5 import QtWidgets as qtwclass NamelistsList(qtw.QFrame):    def __init__(self, default_par, namelistStack):        super().__init__()        self.namelistStack = namelistStack        self.default_par = default_par        self.list = qtw.QListWidget()        self.initListUI()        stackedLayout= self.namelistStack.layout        self.list.currentRowChanged.connect(stackedLayout.setCurrentIndex)                    def initListUI(self):        for namelist in self.default_par.namelists:            self.list.addItem(namelist.name)           layout = qtw.QVBoxLayout()        layout.addWidget(self.list)        self.setLayout(layout)        